-- ----------------------------
DROP TABLE IF EXISTS `userpayments`;
CREATE TABLE `userpayments` (
  `DpID` bigint(21) NOT NULL AUTO_INCREMENT,
  `DpName` varchar(250) NOT NULL,
  `DpUserName` varchar(250) NOT NULL,
  `DpDate` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `DpRecipt` text,
  `DpAmount` text,
  PRIMARY KEY (`DpID`)
) ENGINE=MyISAM AUTO_INCREMENT=1000 DEFAULT CHARSET=latin1;

-- ----------------------------
-- Records of userpayments
