-- ----------------------------
-- Table structure for `users`
-- ----------------------------
DROP TABLE IF EXISTS `users`;
CREATE TABLE `users` (
  `ID` bigint(21) NOT NULL AUTO_INCREMENT,
  `Username` varchar(25) NOT NULL,
  `Email` varchar(100) DEFAULT NULL,
  `Password` varchar(250) NOT NULL,
  `FullName` varchar(150) NOT NULL,
  `Package` varchar(25) NOT NULL,
  `Usr_DeActv` varchar(100) DEFAULT NULL,
  `CNIC` varchar(25) NOT NULL,
  `UsrAdd` text NOT NULL,
  `Active` int(11) NOT NULL DEFAULT '1',
  `Mac` varchar(50) DEFAULT NULL,
  `nasport` varchar(15) DEFAULT NULL,
  `Phone` varchar(12) DEFAULT NULL,
  `Mobile` varchar(12) DEFAULT NULL,
  `creator` varchar(25) NOT NULL,
  `CDate` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `Comment` text,
  `UStatus` int(2) NOT NULL,
  `UExpiry` date NOT NULL,
  PRIMARY KEY (`ID`,`Username`),
  UNIQUE KEY `unique_index` (`Username`)
) ENGINE=MyISAM AUTO_INCREMENT=1000 DEFAULT CHARSET=utf8;

