-- ----------------------------
-- View structure for `activeusers`
-- ----------------------------
DROP VIEW IF EXISTS `activeusers`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `activeusers` AS select count(`users`.`Username`) AS `Totalusers`,`users`.`creator` AS `creator`,`users`.`Package` AS `Package` from `users` where (`users`.`Active` = '1') group by `users`.`creator`,`users`.`Package`;

-- ----------------------------
-- View structure for `monthlybills`
-- ----------------------------
DROP VIEW IF EXISTS `monthlybills`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `monthlybills` AS select `ordersreport`.`DUcustomer` AS `DUcustomer`,date_format(cast(`ordersreport`.`DUdate` as date),'%M-%Y') AS `DUdate`,sum(`ordersreport`.`DUAmount`) AS `totalAmount`,sum(`ordersreport`.`taxamount`) AS `TotalTax` from `ordersreport` group by `ordersreport`.`DUcustomer`,month(`ordersreport`.`DUdate`),year(`ordersreport`.`DUdate`);

-- ----------------------------
-- View structure for `monthlybill_by_manager`
-- ----------------------------
DROP VIEW IF EXISTS `monthlybill_by_manager`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `monthlybill_by_manager` AS select `ordersreport`.`DUcustomer` AS `DUcustomer`,date_format(cast(`ordersreport`.`DUdate` as date),'%M-%Y') AS `Ddate`,sum(`ordersreport`.`DUAmount`) AS `totalAmount`,sum(`ordersreport`.`taxamount`) AS `TotalTax`,`dealer`.`creator` AS `DealerHead` from (`ordersreport` join `dealer` on((`dealer`.`Dlrname` = convert(`ordersreport`.`DUcustomer` using utf8)))) group by `ordersreport`.`DUcustomer`,month(`ordersreport`.`DUdate`),year(`ordersreport`.`DUdate`) order by `ordersreport`.`DUdate`;

-- ----------------------------
-- View structure for `monthlypayments`
-- ----------------------------
DROP VIEW IF EXISTS `monthlypayments`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `monthlypayments` AS select sum(`payments`.`paid`) AS `PaidAmount`,`payments`.`customer` AS `customer`,`payments`.`payment_date` AS `payment_date` from `payments` where (`payments`.`paid` > 0) group by month(`payments`.`payment_date`),year(`payments`.`payment_date`),`payments`.`customer`;

-- ----------------------------
-- Procedure structure for `archive_acct`
-- ----------------------------
DROP PROCEDURE IF EXISTS `archive_acct`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `archive_acct`()
BEGIN
    SELECT NULL,acctsessionid,acctuniqueid,username,groupname,realm,nasipaddress,nasportid,nasporttype,acctstarttime,acctstoptime,acctsessiontime,acctauthentic,connectinfo_start,connectinfo_stop,acctinputoctets,acctoutputoctets,calledstationid,callingstationid,acctterminatecause,servicetype,framedprotocol,framedipaddress,acctstartdelay,acctstopdelay,xascendsessionsvrkey,nasport,creator,package,address
      FROM radacct
    WHERE acctstoptime > 0;
  DELETE FROM radacct
    WHERE acctstoptime > 0;
END
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for `archive_acct-edit`
-- ----------------------------
DROP PROCEDURE IF EXISTS `archive_acct-edit`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `archive_acct-edit`()
BEGIN
    SELECT NULL,acctsessionid,acctuniqueid,username,groupname,realm,nasipaddress,nasportid,nasporttype,acctstarttime,acctstoptime,acctsessiontime,acctauthentic,connectinfo_start,connectinfo_stop,acctinputoctets,acctoutputoctets,calledstationid,callingstationid,acctterminatecause,servicetype,framedprotocol,framedipaddress,acctstartdelay,acctstopdelay,xascendsessionsvrkey,nasport,creator,package,address
      FROM radacct
    WHERE acctstoptime > 0
    AND date(acctstoptime) < (CURDATE());
  DELETE FROM radacct
    WHERE acctstoptime > 0
    AND date(acctstoptime) < (CURDATE());
END
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for `clear_stale_session`
-- ----------------------------
DROP PROCEDURE IF EXISTS `clear_stale_session`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `clear_stale_session`()
BEGIN
UPDATE radacct 
SET radacct.acctstopTime=NOW(),radacct.acctterminatecause='Stale-Session' WHERE ((UNIX_TIMESTAMP(NOW()) - (UNIX_TIMESTAMP(radacct.acctstarttime) + radacct.acctsessiontime)) > 1260) AND (AcctStopTime = '0000-00-00 00:00:00' OR AcctStopTime IS NULL);
END
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for `dropduplicate`
-- ----------------------------
DROP PROCEDURE IF EXISTS `dropduplicate`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `dropduplicate`()
BEGIN
SELECT NULL,username,nasipaddress,'ServerDropCron' FROM (
SELECT COUNT(username) AS onlineentries,username,nasipaddress FROM radacct WHERE acctstoptime IS NULL GROUP BY username
) dum WHERE onlineentries > 1;
END
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for `packageonlinecount`
-- ----------------------------
DROP PROCEDURE IF EXISTS `packageonlinecount`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `packageonlinecount`()
BEGIN

SELECT Count(radacct.username) AS count,radacct.nasipaddress,radacct.package
FROM
radacct
WHERE
radacct.acctstoptime IS NULL
GROUP BY
radacct.nasipaddress,
radacct.package;

END
;;
DELIMITER ;

