DROP EVENT IF EXISTS `EVENT_DROPDUPLICATE`;
DELIMITER ;;
CREATE EVENT `EVENT_DROPDUPLICATE` ON SCHEDULE EVERY 120 SECOND STARTS '2015-03-14 17:59:54' ON COMPLETION PRESERVE ENABLE DO CALL dropduplicate()
