CREATE TRIGGER `Newdealer` BEFORE INSERT ON `dealer` FOR EACH ROW BEGIN
        -- Set the udpate date
    Set new.CDate = now();
END
;;
DELIMITER ;
DELIMITER ;;
CREATE TRIGGER `unitsupdate` BEFORE INSERT ON `orders` FOR EACH ROW BEGIN
	
	SET @PaymentBalance = (SELECT Amount FROM payments WHERE customer=NEW.customer_id ORDER BY payment_date DESC LIMIT 1);
	SET @PaymentID = (SELECT id FROM payments WHERE customer=NEW.customer_id ORDER BY id DESC LIMIT 1);
	
	SET @DealerBalance = (SELECT Balance FROM dealer WHERE Dlrname=NEW.customer_id);
	SET @UnitPrice = (SELECT price FROM dealersrates WHERE dealername=NEW.customer_id AND listname=NEW.product_id);
	SET @UnitTax = (SELECT taxrate FROM package WHERE listname=NEW.product_id);
	
	SET @NewBalance = (@UnitPrice+@UnitTax)*NEW.quantity;
	        
		IF @UnitPrice THEN
			SET @sdfsdfs = '10';
		ELSE
			SET @UnitPrice = '10';
		END IF;
		
	SET new.product_price = @UnitPrice;
	SET new.product_tax = @UnitTax;
    
	UPDATE dealer SET Balance = @DealerBalance+@NewBalance WHERE Dlrname = NEW.customer_id;
	UPDATE payments SET payment_date = CURRENT_TIMESTAMP(), Amount = @DealerBalance+@NewBalance, Balance = @DealerBalance+@NewBalance, ModifyBy = 'SysTriger' WHERE customer = NEW.customer_id AND id = @PaymentID;
	
END
;;
DELIMITER ;
DELIMITER ;;
CREATE TRIGGER `radacctdetails` BEFORE INSERT ON `radacct` FOR EACH ROW BEGIN
	SET NEW.creator = (SELECT  creator FROM users WHERE username = NEW.username);
	SET NEW.package = (SELECT  Package FROM users WHERE username = NEW.username);
	SET NEW.address = (SELECT  UsrAdd FROM users WHERE username = NEW.username);
END
;;
DELIMITER ;
DELIMITER ;;
CREATE TRIGGER `cli` AFTER UPDATE ON `radacct` FOR EACH ROW BEGIN
   if new.callingstationid != "" then
    if new.acctstoptime>0 then
      UPDATE radcheck SET  VALUE = new.callingstationid WHERE attribute='Calling-Station-Id' AND username = new.username;
      UPDATE radcheck SET  VALUE = new.nasport WHERE attribute='NAS-Port-Id' AND username = new.username;
      UPDATE users SET  nasport = new.nasport WHERE Username = new.username;
      UPDATE users SET  Mac = new.callingstationid WHERE Username = new.username;
    end if;
   end if;
  END
;;
DELIMITER ;
DELIMITER ;;
